import { NowRequest, NowResponse } from '@vercel/node'
import { strict } from 'assert';
import Scrapper from './BotFifaArena/Scrapper';
import FactoryFifaArena from './BotFifaArena/FactoryFifaArena';

export default async (resquest: NowRequest, response: NowResponse) => {
  const url = 'http://stats.cyberarena.live/results.aspx?tab=fifa21';

  const contentHTML = await Scrapper.getPageHTML(url);
  const data = new FactoryFifaArena(data);
  const jsonData = await FactoryFifaArena.getGamesResult(contentHTML);

  return response.json(jsonData);
}
